/* * To change this license header, choose License Headers in Project Properties. * To change this template file, choose Tools | Templates * and open the template in the editor. */package com.example.fptacademysystem.dto;import java.io.Serializable;import java.util.Objects;/** * * @author ADMIN */public class ImportSubjectDTO{    private String branchname;    private String coursename;    private Integer semid;    private String subjectname;    private String subjectshortname;    private Integer slot;    private Integer fee;    public ImportSubjectDTO(){        super();    }    @Override    public String toString() {        return "ImportSubjectDTO{" + "branchname=" + branchname + ", coursename=" + coursename + ", semid=" + semid + ", subjectname=" + subjectname + ", subjectshortname=" + subjectshortname + ", slot=" + slot + ", fee=" + fee + '}';    }    public String getBranchname() {        return branchname;    }    public void setBranchname(String branchname) {        this.branchname = branchname;    }    public String getCoursename() {        return coursename;    }    public void setCoursename(String coursename) {        this.coursename = coursename;    }    public Integer getSemid() {        return semid;    }    public void setSemid(Integer semid) {        this.semid = semid;    }    public String getSubjectname() {        return subjectname;    }    public void setSubjectname(String subjectname) {        this.subjectname = subjectname;    }    public String getSubjectshortname() {        return subjectshortname;    }    public void setSubjectshortname(String subjectshortname) {        this.subjectshortname = subjectshortname;    }    public Integer getSlot() {        return slot;    }    public void setSlot(Integer slot) {        this.slot = slot;    }    public Integer getFee() {        return fee;    }    public void setFee(Integer fee) {        this.fee = fee;    }    @Override    public int hashCode() {        int hash = 3;        hash = 53 * hash + Objects.hashCode(this.branchname);        hash = 53 * hash + Objects.hashCode(this.coursename);        hash = 53 * hash + Objects.hashCode(this.semid);        hash = 53 * hash + Objects.hashCode(this.subjectname);        hash = 53 * hash + Objects.hashCode(this.subjectshortname);        hash = 53 * hash + Objects.hashCode(this.slot);        hash = 53 * hash + Objects.hashCode(this.fee);        return hash;    }    @Override    public boolean equals(Object obj) {        if (this == obj)        {            return true;        }        if (obj == null)        {            return false;        }        if (getClass() != obj.getClass())        {            return false;        }        final ImportSubjectDTO other = (ImportSubjectDTO) obj;        if (!Objects.equals(this.branchname, other.branchname))        {            return false;        }        if (!Objects.equals(this.coursename, other.coursename))        {            return false;        }        if (!Objects.equals(this.subjectname, other.subjectname))        {            return false;        }        if (!Objects.equals(this.subjectshortname, other.subjectshortname))        {            return false;        }        if (!Objects.equals(this.semid, other.semid))        {            return false;        }        if (!Objects.equals(this.slot, other.slot))        {            return false;        }        if (!Objects.equals(this.fee, other.fee))        {            return false;        }        return true;    }}